  true,\n\t\"url\": null,\n\t\"notes\": \"The Coastal Data Information Program's station
  data collection consists of all publicly-released coastal environment measurements
  taken over the program's history, a total of 240 distinct datasets spanning 39 years.
  CDIP specializes in wave measurement and analysis, with archives of high-resolution
  spectral wave data that cover multiple decades for many sites. These sustained,
  long-term time series are critical for studies on climate, weather, ocean energy,
  and other subjects. CDIP is funded primarily by the US Army Corps of Engineers and
  the California Department of Parks and Recreation.\",\n\t\"license_title\": \"Creative
